const Card = ({ title, description, onClick, children }) => {
    return (
      <div className="card p-4 shadow-lg rounded-lg" onClick={onClick}>
        <h3 className="text-lg font-bold">{title}</h3>
        <p className="text-gray-600">{description}</p>
        <div className="card-actions mt-4">{children}</div>
      </div>
    );
  };
  
  export default Card;
